How to use $set and dot notation to update embedded array elements using corresponding old element?<p>I have following documents in a MongoDb:</p>
<pre><code>from pymongo import MongoClient
client = MongoClient(host='my_host', port=27017)
database = client.forecast
collection = database.regions
collection.delete_many({})
regions = [
    {
        'id': 'DE',
        'sites': [
            {
                'name': 'paper_factory',
                'energy_consumption': 1000
            },
            {
                'name': 'chair_factory',
                'energy_consumption': 2000
            },
        ]
    },
    {
        'id': 'FR',
        'sites': [
            {
                'name': 'pizza_factory',
                'energy_consumption': 3000
            },
            {
                'name': 'foo_factory',
                'energy_consumption': 4000
            },
        ]
    }
]
collection.insert_many(regions)
</code></pre>
<p>Now I would like to copy the property <code>sites.energy_consumption</code> to a new field <code>sites.new_field</code> for each site:</p>
<pre><code>set_stage = {
    &quot;$set&quot;: {
        &quot;sites.new_field&quot;: &quot;$sites.energy_consumption&quot;
    }
}

pipeline = [set_stage]
collection.aggregate(pipeline)
</code></pre>
<p>However, instead of copying the <strong>individual</strong> value per site, all site values are collected and <strong>added as an array</strong>. Intead of <strong>'new_field': [1000, 2000]</strong> I would like to get <strong>'new_field': 1000</strong> for the first site:</p>
<pre><code>{
    &quot;_id&quot;: ObjectId(&quot;61600c11732a5d6b103ba6be&quot;),
    &quot;id&quot;: &quot;DE&quot;,
    &quot;sites&quot;: [
      {
        &quot;name&quot;: &quot;paper_factory&quot;,
        &quot;energy_consumption&quot;: 1000,
        &quot;new_field&quot;: [
          1000,
          2000
        ]
      },
      {
        &quot;name&quot;: &quot;chair_factory&quot;,
        &quot;energy_consumption&quot;: 2000,
        &quot;new_field&quot;: [
          1000,
          2000
        ]
      }
    ]
  },
  {
    &quot;_id&quot;: ObjectId(&quot;61600c11732a5d6b103ba6bf&quot;),
    &quot;id&quot;: &quot;FR&quot;,
    &quot;sites&quot;: [
      {
        &quot;name&quot;: &quot;pizza_factory&quot;,
        &quot;energy_consumption&quot;: 3000,
        &quot;new_field&quot;: [
          3000,
          4000
        ]
      },
      {
        &quot;name&quot;: &quot;foo_factory&quot;,
        &quot;energy_consumption&quot;: 4000,
        &quot;new_field&quot;: [
          3000,
          4000
        ]
      }
    ]
  }
</code></pre>
<p><strong>=&gt; What expression can I use to only use the corresponding entry of the array?</strong></p>
<p>Is there some sort of <strong>current-index operator</strong>:</p>
<pre><code>$sites[&lt;current_index&gt;].energy_consumption
</code></pre>
<p>or an <strong>alternative dot operator</strong> (would remind me on difference between * multiplication and .* element wise matrix multiplication)?</p>
<pre><code>$sites:energy_consumption
</code></pre>
<p>Or is this a bug?</p>
<p><em>Edit</em></p>
<p>I also tried to use the &quot;$&quot; <a href="https://docs.mongodb.com/manual/reference/operator/update/positional/" rel="nofollow noreferrer">positional operator</a>, e.g. with</p>
<pre><code>sites.$.new_field
</code></pre>
<p>or</p>
<pre><code>$sites.$.energy_consumption
</code></pre>
<p>but then I get the error</p>
<pre><code>FieldPath field names may not start with '$'
</code></pre>
<p><strong>Related:</strong></p>
<p><a href="https://docs.mongodb.com/manual/reference/operator/aggregation/set/#std-label-set-add-field-to-embedded" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/operator/aggregation/set/#std-label-set-add-field-to-embedded</a></p>
<p><a href="https://stackoverflow.com/questions/3828452/in-mongodb-how-do-you-use-set-to-update-a-nested-value-embedded-document">In MongoDB how do you use $set to update a nested value/embedded document?</a></p>

