How can i upload to MongoDB GridFS from loopback 4<p>I'am new to Loopback 4. I was trying to upload files using loopback 4 to MongoDB GridFS.
I used the file upload example from Loopback 4 examples but couldn't understand it enough to modify it?</p>
<pre><code>protected configureFileUpload(destination?: string) {
    const url = 'mongodb://' + MongoDataSource.defaultConfig.user + ':' +
      MongoDataSource.defaultConfig.password
      + '@' + MongoDataSource.defaultConfig.host +
      ':' + MongoDataSource.defaultConfig.port +
      '/' + MongoDataSource.defaultConfig.database;
    const conn = mongoose.createConnection(url);
    let gfs;
    conn.once('open', () =&gt; {
      gfs = Grid(conn.db, mongoose.mongo);
      gfs.collection('uploads');
    });

    const storage = new GridFsStorage({
      url: url,
      file: (req: any, file: any) =&gt; {
        return new Promise((resolve, reject) =&gt; {
          //crypto create a unique id for the file to be uploaded
          crypto.randomBytes(16, (err, buf) =&gt; {
            if (err) return reject(err);
            const filename = buf.toString('hex') + path.extname(file.originalname);
            const fileInfo = {
              filename: filename,
              bucketName: 'bucketName',
              metadata: {
                originalName: file.originalname,
                encoding: file.encoding,
                mimetype: file.mimetype,
                size: file.size,
                expires: Date.now() + 1000 * 60 * 60
              }
            }
            resolve(fileInfo)
          })
        });
      }
    });
    storage;

    return multer({storage: storage}).any();
  }
</code></pre>

