MongoDB FindOptions when using Typescript<p>I am converting a JS project to TS and am struggling with FindOptions when I am querying a collection. I just want to get the Ids of all elements of a collection. This is the TS code   that is causing TS errors:</p>
<pre class="lang-js prettyprint-override"><code>import { Collection, Db, Document, MongoClient } from &quot;mongodb&quot;;

type MyDoc = {
    _id: object,
    title: string,
    image: string,
    description: string
} 

const client: MongoClient = await MongoClient.connect(&quot;mongodb://127.0.0.1:27017&quot;);
const db: Db = client.db(&quot;mydb&quot;);
const myCollection: Collection&lt;MyDoc&gt; = db.collection(&quot;myCollection&quot;);
const ids: object[] = await myCollection.find({}, { _id: 1 }).toArray();
client.close();
</code></pre>
<p>The problem there is the <code>{_id: 1}</code> FindOption that is working fine in JS. This is the error message:</p>
<pre><code>Argument of type '{ _id: number; }' is not assignable to parameter of type 'FindOptions&lt;Document&gt;'.
      Object literal may only specify known properties, and '_id' does not exist in type 'FindOptions&lt;Document&gt;'.
</code></pre>

