<pre class="lang-json prettyprint-override"><code>[
  {
    &quot;_id&quot;: &quot;abc&quot;,
    &quot;field1&quot;: [], // array of subdocuments, may be empty
    &quot;field2&quot;: &quot;somVal&quot;,
    &quot;field3&quot;: [  // array of subdocuments, may be empty
      {
        &quot;fieldToSort&quot;: &quot;bcdef&quot;
      },
      {
        &quot;fieldToSort&quot;: &quot;abcde&quot;
      }
    ]
  },
  {
    &quot;_id&quot;: &quot;def&quot;,
    &quot;field1&quot;: [  // array of subdocuments, may be empty
      {
        &quot;fieldToSort&quot;: &quot;bcdef&quot;
      },
